/*Table structure for table `blogentry` */

DROP TABLE IF EXISTS `blogentry`;

CREATE TABLE `blogentry` (
  `id_be` int(11) NOT NULL AUTO_INCREMENT,
  `id_sc` int(11) NOT NULL,
  `id_user` int(11) NOT NULL,
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `con` datetime NOT NULL,
  `body` longblob NOT NULL,
  `active` int(11) DEFAULT NULL,
  `id_userliked` int(11) NOT NULL DEFAULT '0',
  `cover` longblob NOT NULL,
  `priority` int(11) DEFAULT '999',
  `des` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id_be`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

